			rd[finish + 1] = (1 << i) - 1;

			for (j = finish; j >= start; j--) {
				// The alphabet <pattern_alphabet> is a sparse hash, so the following line generates warnings.
				charMatch = pattern_alphabet[text.charAt(j - 1)];
